sidebarCSS:
#root.root {
  --tabs-indent: 0px;
  --general-border-radius: 4px;
  --tabs-height: 32px;
  --tabs-margin: 6px;
  --pinned-tabs-col: 4;
  flex-direction: column;
}

.NavigationBar .main-items {
  justify-content: center;
}

.Tab {
  min-width: 33px;
  transition: all ease-in-out 200ms;
}

.NavigationBar {
  transition: all ease-in-out 200ms;
}

/* ✅ Show all nav-items regardless of active state */
.NavigationBar[data-layout="inline"] .main-items .nav-item {
  transform: translateX(0) !important;
  position: relative !important;
  flex-grow: 1;
  max-width: 66px;
  display: flex !important;
}

/* ✅ No longer hide inactive nav items */
.NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
  display: flex !important;
}

/* ✅ Always show all panels when visible */
.PanelsContainer {
  display: flex !important;
  visibility: visible !important;
  height: auto !important;
  max-height: none !important;
  flex-direction: column;
  gap: 12px;
}

/* ✅ Ensure hidden panels are shown properly */
.PanelsContainer .panel {
  display: flex !important;
  visibility: visible !important;
  height: auto !important;
  max-height: none !important;
  flex-direction: column;
}

.PanelsContainer .panel[data-active="false"] {
  display: flex !important;
  visibility: visible !important;
  opacity: 1 !important;
  pointer-events: auto !important;
}

/* ✅ Hide panels when sidebar is collapsed */
#root.root[data-sidebar="collapsed"] .PanelsContainer {
  display: none !important;
}

@media (max-width: 100px) {
  .PanelsContainer {
    display: none !important;
  }
}

.BottomBar {
  display: none;
}

/* Show title (text) when expanded */
.Tab .audio,
.Tab .title {
  opacity: 1 !important;
  transition: ease-in-out 250ms;
  display: inline !important;
}

/* Adjust icon/text spacing if needed */
.Tab .title {
  margin-left: 6px;
}

/* Keep pinned icon sizes */
.Tab[data-pin="true"] .fav,
.Tab[data-pin="true"] .fav-icon {
  width: 20px;
  height: 20px;
}

.Tab[data-pin="false"] .fav,
.Tab[data-pin="false"] .fav-icon {
  width: 18px;
  height: 18px;
}

/* Remove color theming */
.Tab[data-pin="true"][data-active="true"] .color-layer {
  background-color: transparent !important;
}

.Tab[data-pin="false"] .color-layer {
  opacity: 0 !important;
  border: 0 !important;
}

.Tab[data-pin="false"][data-active="true"] .body {
  box-shadow: none;
}

.Tab[data-pin="false"] {
  border: 0 !important;
}

.Tab .title {
  background: none;
  background-clip: unset;
  color: inherit;
}

/* Responsive adjustments */
@media screen and (min-width: 350px) {
  .NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
    display: flex !important;
  }
  .BottomBar {
    display: flex;
  }
  #root.root {
    --tabs-indent: 14px;
  }
  .Tab .audio,
  .Tab .title {
    opacity: 1 !important;
    display: inline !important;
  }
  #root.root {
    --tabs-pinned-height: 40px;
  }
  #root.root {
    --tabs-pinned-width: calc((100vw - (var(--tabs-margin) * (var(--pinned-tabs-col) + 1))) / var(--pinned-tabs-col));
  }
}
